        const {insertedId} = result;

        jwt.sign({id: insertedId, email}, process.env.JWT_SECRET, {expiresIn:'2d'}, (err, token) => {
            if (err) res.status(500).send(err);
            res.status(200).json({token});
        });
    }
}

